    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Wildlife Refuge summarizes refuge activities from May through August of 1949.  The
    report begins with general information about weather conditions and fires on the
    refuge.  Wildlife- including migratory birds, upland game birds, big game animals,
    and fur animals- is also covered.  The report includes a refuge development section
    which discusses physical developments and plantings on the refuge.  Economic uses
    of the refuge are outlined; timber removal was the only use during this period.
     A progress report on field investigations is included.  The public relations section
    of the report discusses recreational uses of the refuge, refuge visitors, refuge
    participation, hunting, fishing, and enforcement.  N-R forms are provided at the
